description:
It was an adventurous afternoon for Willa. She wanders around the city with her new boyfriend, stealing kisses on every corners, enjoying the things she just get introduced to. But the afternoon gets really exciting when they go up to his apartment so he can introduce her something more interesting, more exciting... and Willa gets to be a really happy teenager.

